import React from 'react';

import '../css/header.css';
import '../css/main.css';
import '../css/footer.css';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';

import 'swiper/css/pagination';
import 'swiper/css/autoplay';
import {Navigation, Pagination, Autoplay} from 'swiper/modules';

<script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/js/bootstrap.bundle.min.js" integrity="sha384-YvpcrYf0tY3lHB60NNkmXc5s9fDVZLESaAA55NDzOxhy9GkcIdslK1eN7N6jIeHz" crossorigin="anonymous"></script>




/* AQUI INICIA FUNCIONES MADRES */
function Header() {
  return (
    <header className="padre_header">
      <HeaderInformativo />
      <HeaderPrimerBarraNav/>
      <HeaderSegundaBarraNav/>
    </header>    
  );
}



function Main() {
  return (
    <main>
      <Categorias/>
      <Carousel/>
      <EventosNovedades/>
      <SeccionInfor/>
      <AcercaDe/>
    </main>

  );
}

function Footer() {
  return (
    <footer>
      <BarraInformativa1/>
      <Derechos/>
    </footer>
  );
}

/* AQUI FINALIZA FUNCIONES MADRES */
/*AQUI INICIA FUNCION DE CARROUSEL DE IMAGENES */
var swiper = new Swiper(".mySwiper",{
  effect: "coverflow",
  grabCursor: true,
  centeredSlides: true,
  slidesPerView: "auto",
  loop: true,
  coverflowEffect: {
          depth:500,
          modifier:1,
          slidesShadows:true,
          rotate:0,
          strech:0

  }
})

function Carousel() {
  const slides = [
    {
      id: 1,
      price: '$600.000',
      title: 'SH-PRO612DV',
      description: 'Casco con spoiler agresivo, ventilación completa y diseño estilizado para mayor comodidad y rendimiento en moto.',
      image: 'img/Casco Shaft.png',
      logo: 'img/shaft.png',
    },
    // ... Agrega más objetos para los otros slides
  ];

  return (
    <Swiper
      modules={[Navigation, Pagination, Autoplay]}
      spaceBetween={30}
      slidesPerView={1}
      navigation
      pagination={{ clickable: true }}
      autoplay={{ delay: 3000 }}
      className="mySwiper"
    >
      {slides.map((slide) => (
        <SwiperSlide key={slide.id}>
          <div className="icons">
            <i className="fa-solid fa-circle-arrow-left"></i>
            <img src={slide.logo} alt="" />
            <i className="fa-regular fa-heart"></i>
          </div>
          <div className="product-content">
            <div className="product-txt">
              <span>{slide.price}</span>
              <h3>{slide.title}</h3>
              <p>{slide.description}</p>
            </div>
            <div className="product-img">
              <img src={slide.image} alt={slide.title} />
            </div>
          </div>
